              voluptatem necessitatibus repellendus nostrum veritatis, minima,
              maxime ullam ipsam ea nobis ad eligendi nulla quaerat nesciunt,
              labore adipisci ab itaque iusto?
            </p>
          </HistoryOfHospital>
        </MainContainer>
      </div>
    </AboutWebsiteContainer>
  );
}

const AboutWebsiteContainer = styled.div`
  position: relative;
  top: 60px;
`;

const MainContainer = styled.div`
  width: 100%;
  position: relative;
  left: 0px;
  top: 40px;
  text-align: center;
  border: 2px solid crimson;
`;

const HistoryOfHospital = styled.div`
  border: 2px solid green;
`;
